import React from 'react';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import LogoBox from './components/LogoBox';
import HeroSection from './components/HeroSection';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <div className="wrapper">
      <Router>
        <Navbar />
        <Routes>
          <Route path='/' element={
            <div>
              <LogoBox />
              <HeroSection title="Home" buttons={[
                {text: "Subjects", link: "/subjects"},
                {text: "Resources", link: "/resources"},
                {text: "About Us", link: "/about"},
                {text: "Submit", link: "/submit"}
              ]}/>
            </div>
          } />
          <Route path='/subjects' element={
            <div>
              <HeroSection title="Subjects" buttons={[
                {text: "Mathematics", link: "/subjects/mathematics"},
                {text: "Economics", link: "/subjects/economics"},
                {text: "", link: "/about"},
                {text: "Submit", link: "/submit"}
              ]}/>
            </div>
          } />
          <Route path='/resources' element={
            <div>
              <h1>These are the resources.</h1>
            </div>
          } />
        </Routes>
        <div className="content"/>
        <Footer />
      </Router>
    </div>
  );
}

export default App;
